import React from 'react';
import { Box, Container, Text } from '@chakra-ui/react';

const RightSideBar = () => {
  return (
    <Box>
      <Container mt="5">
        <Text fontSize={"18"} color="white" margin="auto" as='b'>
          Future Features
        </Text>
      </Container>
    </Box>
  );
};

export default RightSideBar;
